import React from 'react';
import LineGraph  from './components/LineGraph';
import RoomInputGrid from './components/RoomInputGrid';

const App = () => {
    const plotData = [[0, 1], [1, 2], [2, 4], [3, 2], [4, 7], ]
    return (
        <>
            <RoomInputGrid data={[
            { title: "Material", field: "Material" },
            { title: "Area (M^2)", field: "Area", type: "numeric" },
          ]}/>
            <LineGraph data={plotData} />
        </>
    );
};



export default App;
